measurements.description:
Twenty flat flowers and 30 buds on six staked, branched, up to 23-cm inflorescences;
 33-cm wide by 35-cm tall plant, 12-cm clay pot, grown in sphagnum moss;
 sepals and petals gold-chartreuse overlaid magenta,
 dorsal sepal oval, lateral sepals and petals elliptic;
 lip white overlaid dark fuchsia, side lobes erect, rhomboid, midlobe spatulate, apex white, callus yellow;
 column white, flushed light magenta basally, anther cap white; 
 substance firm; texture crystallne; also received award 20255304.
